// import React from "react";

import "./App.css";
import { Select } from "./components/Select";

const options = [
  {
    label: "First",
    value: 1,
  },
  {
    label: "second",
    value: 2,
  },
  {
    label: "third",
    value: 3,
  },
  {
    label: "fourth",
    value: 4,
  },
];

function App() {
  return (
    <div className="App">
      <h1>Input project</h1>
      <Select options={options} />
    </div>
  );
}

export default App;
